exports=async function(bid,options){const{parseCatalogPaginate,getSelectLastOption,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalogPaginate(page=>`https://m.biqugetv.net/${bid.idPrefix()}_${bid}${1===page?"":"_"+page}/`,{cleaner:html=>cleanCatalogWrapper(html,/class="chapter"/,"</ul>",-1),recordRegex:hrefRecordRegex},{...options,clientOptions:{...(options&&options.clientOptions),"x-mobile":1},pageSize:100,totalPagesRegex:html=>getSelectLastOption(html,s=>-1!==s.indexOf("\u7AE0"))?.subRegex(/\/\d+_\d+_(\d+)\/?"/)?.intValue()})};